(2107, 21, 'R2-CS- WP-33', 'Providing waterproofing treatment from outside to basement lift-pits and other under ground structures during construction. The treatment shall be started after the P.C.C. bedding for the base slab or raft slab is laid. On theP.C.C. bedding a waterproofing layer based on cement with rough shahabad stones of 20 to 25 mm thick well pointed in the joints with 1:3 C.S. 40 mm thick for floors and 20 mm thick for sides with cement float and water proofing compound as per specifications shall be laid. Then the surface shall be superimposed by regular R.C.C. raft or base slab as per design. After completion of the raft / base slab and side walls the treatment of waterproofing layer shall be continued along the outer surface of the walls upto a height of 30 cm above the adjacent ground level. (The excavation of the side around the walls shall be filled with soft earth by the contractor ). The total thickness of the treatment shall be 65 mm to 75 mm forfloors and 32 mm to 38 mm for walls.', 1145, 1336, 'Sqm', 1529720, 25, '2022-05-30 12:42:25', NULL, NULL, 1, 25, '2022-05-30 12:46:41'),
